import './App.css';
import { Text } from "./Text.js";
import { Images } from "./Images.js";
function App() {
	return (
		<div className="App">
			<div className="continer">
				<div className="text-box">
					<Text />
				</div>
				<div className="img-box">
					<Images />
				</div>
			</div>
		</div>
	);
}

export default App;
